import axios from 'axios'
let data=null
const getRandomUserData=async()=>{
    await axios.get('https://randomuser.me/api')
    .then(res=>{
        console.log(res)
        data=res.data.results
    }).catch(err=>{console.log(err)})
    return data;
}
